import React from 'react'
import Header from '../header'
import PatientListCard from '../patientListCard'
import SubHeader from '../subHeader'

export default function PatientList() {
    return (
        <div>
            <Header/>
            <SubHeader label={"Manage Patients"}/>
            <div className="d-flex justify-content-end me-3 mt-3">
                <button data-bs-toggle="modal" data-bs-target="#exampleModal" className="btn btn-primary">+ Add New Patient</button>
            </div>
            <PatientListCard/>  
        </div>



    )

}

